              <h1><i class="fa fa-envelope"></i><span>Password Reset Email Sent Successfully!</span></h1>
              <p>check your inbox,open password reset email , Click on link.And you can reset your password now</p>
              <a href="/login" class="btn btn-primary btn-lg">Go Home</a>
